import React, { Component} from "react";

class Home extends Component{
    state = {
        counter: 0,
    };
    render() {
        return (
            <main>
                <h1 className="text-center mt-5"> Robot Control Page</h1>
                <h5>Counter: </h5>
                <p>{this.state.counter}</p>
            </main>
        );
    }
}

export default Home;
